import React from 'react'
import Input from '@material-ui/core/Input';
import Button from '@material-ui/core/Button';
import AddIcon from '@material-ui/icons/Add';




const App = () =>{

    return(
        <>
        <div className="wrapper">
            <div className="container">
                <h1 className="heading">To Do List</h1>
                <Input style = {{color: 'white'}} className = "title-input" placeholder = "Title"/>
                <Input type = "textarea" style = {{color: 'white'}} className = "note-input" placeholder = "Note"/>
                <Button className = "btn" style = {{backgroundColor: 'white'}} color="primary"><AddIcon/></Button>
              
            </div>
        </div>
        </>
    )
}


export default App;
